import React from 'react'
import { Descriptions, Button, List, Avatar, Space } from 'antd';
import { MessageOutlined, LikeOutlined, StarOutlined } from '@ant-design/icons';

const listData = [];
for (let i = 0; i < 3; i++) {
    listData.push({
        href: 'https://ant.design',
        title: `ant design part ${i}`,
        avatar: 'https://zos.alipayobjects.com/rmsportal/ODTLcjxAfvqbxHnVXCYX.png',
        description:
            'Ant Design, a design language for background applications, is refined by Ant UED Team.',
        content:
            'We supply a series of design principles, practical patterns and high quality design resources (Sketch and Axure), to help people create their product prototypes beautifully and efficiently.',
    });
}



const BookingCardAntd = () => {
    return (
        <List
            itemLayout="vertical"
            size='default'
            style={{
                width:'50%'
            }}
            dataSource={listData}
            renderItem={item => (
                <List.Item
                    style={{
                        backgroundColor:'#DCC8D5',
                        width:'100%',  
                        padding:'20px 0px 10px 0px', 
                        marginBottom:'10px',
                        border:'2px solid white',
                        borderRadius:'10px',
                    }}
                    key={item.title}
                >
                    <List.Item.Meta
                        // avatar={<Avatar src={item.avatar} />}
                        style={{
                            backgroundColor:'#DCC8D5'
                        }}
                        title={
                            <div style={{backgroundColor:'white',paddingRight:'30px',}}>
                                <div style={{fontSize:'20px',textAlign:'right', fontFamily:'Montserrat'}}>27 March 2020</div>
                                <div style={{fontSize:'30px',textAlign:'right', fontFamily:'Montserrat', fontWeight:'bold'}}>
                                    Cat on the roof #3
                                </div>
                            </div>}
                        description={
                            <div style={{backgroundColor:'black',paddingRight:'30px'}}>
                                <h2 style={{fontSize:'15px',textAlign:'right', fontFamily:'Montserrat', color:'white'}}>จำนวนคน</h2>
                                <h5 style={{fontSize:'10px',textAlign:'right', fontFamily:'Montserrat', color:'white'}}>เอาโต๊ะในครับ</h5>
                            </div>
                        }
                    />
                </List.Item>
            )}
        />
    )
}

export default BookingCardAntd
